import React from "react";
import Button from "./Button";

const Header = ({ title , showAdd}) => {
  return (
    <header className="header">
      <h1>{title}</h1>
      <Button text={showAdd ? 'Close': 'Add'} />
    </header>
  );
};

export default Header;
